import React from 'react';
import MiniDrawer from './Homepage';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Layout from './Component/Layout/matrix';

const App = () => {
  return (
    <Router>
      <MiniDrawer />
      <Routes path="/layout" element={<Layout />} />
    </Router>
  );
};

export default App;
